pragma solidity ^0.8.28;

import "https://github.com/Vectorized/solady/blob/main/src/auth/Ownable.sol";
import "https://github.com/Vectorized/solady/blob/main/src/tokens/ERC20.sol";

contract Guano is ERC20,Ownable {
    uint immutable created = block.timestamp;
    uint totalMinted = 0;
    uint totalDeposited = 0;
    uint totalBurned = 0;
    uint totalWithdrawn = 0;

    constructor(){
        _initializeOwner(msg.sender);
    }

    function name() public pure override returns (string memory){
        return "Kaiju Guano";
    }
    
    function symbol() public pure override returns (string memory){
        return "GUANO";
    }

    function availableShares() public view returns (uint) {
        return (block.timestamp - created) / 24 hours - totalMinted;
    }
    
    function convertToShares(uint assets) public view returns (uint) {
        return assets / totalDeposited * availableShares();
    }
    
    function previewDeposit(uint assets) public view returns (uint) {
        return convertToShares(assets);
    }

    function mint() payable public {
        _mint(msg.sender, previewDeposit(msg.value));
    }

    function burn(address sender, uint amount) public {

    }
}

